INSERT INTO `ideas` (`id`, `startdate`, `enddate`, `title`, `description`, `place`, `picture`, `email`, `link`, `cost`, `addeddate`, `groupid`, `ambassador`, `location_id`, `promotional_period`, `auction_price`, `end_at_date`, `ad_lives`, `customer_id`) VALUES
(1, '2014-10-15', '2015-11-15', 'Fridays on Black River $55!', '<p>\n	<span style=\\"color:#d3d3d3;\\">Make the most of the summer months by getting out of town with this LivingSocialOriginal: a day of whitewater rafting on the Lehigh River with lunch.</span></p>\n', 'new york, ny', '21285szloven_2.jpg', '', 'http://www.aroadventures.com/', '55', '2014-10-10 17:13:13', '0', '5', '112', '365', '0', '', '100', ''),
(3, '2014-10-15', '2015-10-15', 'American Museum of Natural History', '<p>\n	<span style=\\"color:#d3d3d3;\\"><span style=\\"font-size:12px;\\">General admission includes admission to the museum&#39;s 45 permanent halls and the Rose Center for Earth and Space. Tickets may be required for special exhibitions, Space Shows, LeFrak Theater films, and programs. Students, seniors, and children receive discounts.</span></span></p>\n', 'NYC', '391494306NYC___Natural_Museum.png', '', 'http://www.amnh.org/plan-your-visit', '37', '2014-10-15 10:33:40', '0', '5', '112', '365', '0', '', '100', ''),
(4, '2014-10-16', '2015-03-01', 'NYC Helicopter Tour', '<p>\r\n	<span style=\\"font-family:arial,helvetica,sans-serif;\\"><span style=\\"font-size:12px;\\"><span style=\\"color:#d3d3d3;\\">Fox News and Yahoo!Travel journalists recently took and recommend this tour, while Travelzoo users call it &quot;amazing,&quot; &quot;spectacular&quot; and &quot;an absolute must.&quot; Soar over the NYC skyline, Statue of Liberty, Freedom Tower and Brooklyn Bridge &quot;The view from above truly is the best view of New York City&quot; (Yahoo!Travel) Fox News says it offers &quot;breathtaking&quot; views &quot;you won&#39;t get anywhere else&quot; 4 stars and a Certificate of Excellence 2014 from TripAdvisor</span></span></span></p>\r\n', 'NYC', '2101351631nychelicopter.jpg', '', 'http://www.travelzoo.com/local-deals/Manhattan/Other/132644', '119', '2014-10-16 09:15:13', '0', '5', '112', '365', '0', '', '100', ''),
(6, '2015-01-01', '2015-03-27', 'Free Friday Night at the Rubin Museum of Art', '<p>\r\n	<span style=\\"font-family:arial,helvetica,sans-serif;\\"><span style=\\"font-size:12px;\\"><span style=\\"color:#d3d3d3;\\">Artist Francesco Clemente will take to the stage with Eric Ripert, Billie Tsien, David Chase, Alfonso Cuaron, and others for a series of freewheeling conversations.</span></span></span></p>\r\n', 'new york, ny', '38209626Rubin_Museum.jpg', '', 'http://www.rubinmuseum.org/', '0', '2014-10-16 09:32:16', '0', '5', '112', '365', '0', '', '100', ''),
(7, '2014-10-17', '2014-10-31', 'Central Park Hidden Secrets Walking Tour', '<p>\r\n	<span style=\\"font-family:arial,helvetica,sans-serif;\\"><span style=\\"font-size:12px;\\"><span style=\\"color:#d3d3d3;\\">Take a walk on the road less traveled in Central Park and discover its hidden gems! Tour the hard to find places that most people don&#39;t ever get to see. Central Park&#39;s 843 acres are a challenge to cover on your own. Together with your knowledgeable tour guide you&#39;ll experience some of the lesser-known treasures and see just how full of history and natural beauty that Central Park really is.</span></span></span></p>\r\n', 'new york, ny', '1666615515central_park_fall_002.jpg', '', 'http://www.centralpark.com/guide/tours/walking.html', '95', '2014-10-16 10:18:09', '0', '5', '112', '365', '0', '', '100', ''),
(11, '2014-10-31', '2014-10-31', 'Harlem Renaissance Walking Tour', '<p>\r\n	<span style=\\"font-family:arial,helvetica,sans-serif;\\"><span style=\\"color:#d3d3d3;\\"><span style=\\"font-size:12px;\\">Harlem is one of New York&rsquo;s secret treasures with some of the city&rsquo;s most magnificent architecture and delicious food. This neighborhood has raised some of the most talented musicians, singers and writers during the Harlem Renaissance who would help educate and enrich the lives of many to come. Places we will cover on this tour: Schomberg Center, Louie Armstrong, Duke Ellington, The Cotton Club, The Savoy Ballroom, Connie&#39;s Inn, Ella Fitzgerald, Langston Hughs, Strivers Row, Abyssinian Baptist Church, Sylvia&rsquo;s Soul-food Restaurant, Apollo Theater, and much more!&nbsp;</span></span></span></p>\r\n', 'harlem, ny', '1386145759Cotton_Club.jpg', '', 'http://www.meetup.com/ToursofManhattan/events/185427942/', '20', '2014-10-19 08:37:42', '0', '5', '112', '365', '0', '', '100', ''),
(12, '2014-10-19', '2014-12-31', 'Blue Man Group', '<p>\r\n	<span style=\\"font-family:arial,helvetica,sans-serif;\\"><span style=\\"font-size:12px;\\"><span style=\\"color:#d3d3d3;\\">Spawned from a vibrant combination of eclectic, multi-media street art, Blue&nbsp;Man Group has emerged as one of the most successful off-Broadway shows&nbsp;ever. The trio of bald, cobalt-colored men blend a set of stellar percussion skills&nbsp;with impeccable comedic timing to create a sensory-stimulating show unlike any&nbsp;other. The wildly popular show at the Astor Place Theatre now combines signature&nbsp;moments with breathtakingly fun new pieces. As theatrical experiences go, this is&nbsp;one not to be missed.</span></span></span></p>\r\n<p>\r\n	<br />\r\n	<span style=\\"font-family:arial,helvetica,sans-serif;\\"><span style=\\"font-size:12px;\\"><span style=\\"color:#d3d3d3;\\">-----------------------------------------------<br />\r\n	Choose from the following offers:<br />\r\n	<br />\r\n	&bull; $59 ($85 value) for one orchestra or mezzanine ticket<br />\r\n	&bull; $85 ($95 value) for one poncho ticket<br />\r\n	<br />\r\n	---------------------- --------------------</span></span></span><br />\r\n	<br />\r\n	&nbsp;</p>\r\n', 'Astor Place Theatre | New York, NY ', '949145883bluemangorup001.jpg', '', 'https://www.livingsocial.com/events/1295600-ticket-to-blue-man-group?afsrc=1&city_name=NYC%20Midtown&cvosrc=email.blast.digest_dailyus&preferred_city_id=3&utm_campaign=digest_dailyus&utm_content=3&utm_medium=email&utm_source=blast&city_id=3-nyc-midtown&id=1295600-ticket-to-blue-man-group&msdc_id=3-nyc-midtown', '59', '2014-10-19 09:08:00', '0', '5', '112', '365', '0', '', '100', ''),
(13, '2015-03-16', '2015-05-16', 'Fuerza Bruta', '<p style=\\"margin: 0px 0px 9px; padding: 0px; border: 0px; font-family: \\''Helvetica Neue\\'', Arial, Helvetica, sans-serif; font-size: 13px; font-stretch: inherit; vertical-align: baseline; line-height: 18px; color: rgb(51, 51, 51);\\">\r\n	<span style=\\"font-family:arial,helvetica,sans-serif;\\"><span style=\\"font-size:12px;\\"><span style=\\"color:#d3d3d3;\\">Bringing the hit Off-Broadway show Fuerza Bruta back to New York City after a decade of worldwide success, Fuerza Bruta is an uninhibited and unforgettable show you have to see to believe. This theatrical thrill ride includes heart-thrashing fun, fast-paced live music, on-stage musicians, and breathtaking aerial displays. Called &quot;sexy, heart-pounding fantasy&quot; by&nbsp;<em style=\\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-stretch: inherit; vertical-align: baseline; line-height: 1;\\">Daily News,&nbsp;</em>you can catch this fresh show on your choice of date through March 31 with this offer for one general admission ticket.</span></span></span></p>\r\n<p style=\\"margin: 0px 0px 9px; padding: 0px; border: 0px; font-family: \\''Helvetica Neue\\'', Arial, Helvetica, sans-serif; font-size: 13px; font-stretch: inherit; vertical-align: baseline; line-height: 18px; color: rgb(51, 51, 51);\\">\r\n	<span style=\\"font-family:arial,helvetica,sans-serif;\\"><span style=\\"font-size:12px;\\"><span style=\\"color:#d3d3d3;\\"><strong style=\\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-stretch: inherit; vertical-align: baseline; line-height: 1;\\">Choose from the following offers:</strong>&nbsp;<br />\r\n	&bull; $49 ($75 value) for one Wednesday, Thursday, or Sunday matinee ticket&nbsp;<br />\r\n	&bull; $59 ($89 value) for one Friday, Saturday, or Sunday evening ticket</span></span></span></p>\r\n', 'Union Square, nyc', '300151789324c5166_a8ee_48c9_9900_e31b19d030d7_700_q90.jpg', '', 'https://www.livingsocial.com/events/1384698-ticket-to-fuerza-bruta?append_ref_code=home_page_showcase', '49', '2015-03-16 15:02:26', '0', '5', '112', '365', '0', '', '100', ''),
(14, '2016-11-01', '2017-04-30', '50 Shades! The Musical', '<p style="margin: 0px 0px 9px; padding: 0px; border: 0px; font-family: ''Helvetica Neue'', Arial, Helvetica, sans-serif; font-size: 13px; font-stretch: inherit; vertical-align: baseline; line-height: 18px; color: rgb(51, 51, 51);">\r\n	<span style="color:#d3d3d3;"><span style="font-family:arial,helvetica,sans-serif;"><span style="font-size:12px;">What happens when steamy characters make the leap from story to stage? Find out at &quot;50 Shades! The Musical - The Parody.&quot; This original parody of the hit novel features laughs and love interests aplenty -- along with plenty of songs and off-the-(hand)cuff humor. Catch all the action for yourself with this offer for a ticket to your choice of performance through May 31.</span></span></span></p>\r\n<p style="margin: 0px 0px 9px; padding: 0px; border: 0px; font-family: ''Helvetica Neue'', Arial, Helvetica, sans-serif; font-size: 13px; font-stretch: inherit; vertical-align: baseline; line-height: 18px; color: rgb(51, 51, 51);">\r\n	<span style="color:#d3d3d3;"><span style="font-family:arial,helvetica,sans-serif;"><span style="font-size:12px;"><strong style="margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-stretch: inherit; vertical-align: baseline; line-height: 1;">Choose from the following offers:</strong><br />\r\n	&bull; $39 or $49 ($79 value) for one ticket</span></span></span></p>\r\n', 'Elektra Theatre New York, NY ', '2489063492bbf8dae_edd3_433e_b3a7_253fdefb93d0_700_q90.jpg', '', 'https://www.livingsocial.com/events/1246332-ticket-to-50-shades-the-musical', '159', '2015-03-16 16:43:48', '0', '5', '112', '365', '0', '', '100', ''),
(15, '2015-03-09', '2015-06-30', 'Ice Bar', '<div class=\\"included prominent\\" style=\\"margin: 0px; padding: 0px; border: 0px; font-family: \\''Helvetica Neue\\'', Arial, Helvetica, sans-serif; font-size: 13px; font-stretch: inherit; vertical-align: baseline; line-height: 8.66666698455811px; color: rgb(51, 51, 51);\\">\r\n	<ul style=\\"margin: 0px 0px 10px; padding-right: 0px; padding-left: 0px; border: 0px; font-family: inherit; font-size: 14px; font-variant: inherit; font-stretch: inherit; vertical-align: baseline; line-height: 1;\\">\r\n		<li style=\\"margin: 0px; padding: 8px 0px 8px 18px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(209, 209, 209); font-family: inherit; font-size: inherit; font-variant: inherit; font-stretch: inherit; vertical-align: baseline; line-height: 1.5; list-style-position: inside; text-indent: -16px;\\">\r\n			<span style=\\"font-family:arial,helvetica,sans-serif;\\"><span style=\\"font-size:12px;\\"><span style=\\"color:#d3d3d3;\\">Ice Bar Experience for Two</span></span></span></li>\r\n		<li style=\\"margin: 0px; padding: 8px 0px 8px 18px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(209, 209, 209); font-family: inherit; font-size: inherit; font-variant: inherit; font-stretch: inherit; vertical-align: baseline; line-height: 1.5; list-style-position: inside; text-indent: -16px;\\">\r\n			<span style=\\"font-family:arial,helvetica,sans-serif;\\"><span style=\\"font-size:12px;\\"><span style=\\"color:#d3d3d3;\\">Bundle Up with The Coolest Experience Package, or Opt for the VIP Treatment</span></span></span></li>\r\n		<li style=\\"margin: 0px; padding: 8px 0px 8px 18px; border-top-width: 0px; border-right-width: 0px; border-left-width: 0px; border-bottom-style: none; font-family: inherit; font-size: inherit; font-variant: inherit; font-stretch: inherit; vertical-align: baseline; line-height: 1.5; list-style-position: inside; text-indent: -16px;\\">\r\n			<span style=\\"font-family:arial,helvetica,sans-serif;\\"><span style=\\"font-size:12px;\\"><span style=\\"color:#d3d3d3;\\">Stop by Any Night of the Week!</span></span></span></li>\r\n	</ul>\r\n</div>\r\n<div class=\\"deal-description\\" itemprop=\\"description\\" style=\\"margin: 0px; padding: 0px; border: 0px; font-family: \\''Helvetica Neue\\'', Arial, Helvetica, sans-serif; font-size: 13px; font-stretch: inherit; vertical-align: baseline; line-height: 8.66666698455811px; color: rgb(51, 51, 51);\\">\r\n	<p style=\\"margin: 0px 0px 9px; padding: 0px; border: 0px; font-variant: inherit; font-stretch: inherit; vertical-align: baseline; line-height: 18px;\\">\r\n		<span style=\\"font-family:arial,helvetica,sans-serif;\\"><span style=\\"font-size:12px;\\"><span style=\\"color:#d3d3d3;\\">At Minus5 Ice Bar, everything is made of ice, including the chairs, tables, and even the glasses you drink from -- it&#39;s truly &quot;The coolest experience in NYC.&quot; Stop by the New York location, at the New York Hilton Midtown, for a one-of-a-kind night out. You&#39;ll grab your cold-weather gear and start exploring -- an on-staff ice carver creates sculptures throughout the year, and an exciting LED light show accompanies upbeat music and a temperature-controlled atmosphere. Check out the&nbsp;</span><a href=\\"http://minus5ny.zenfolio.com/p694370062/h3fb57c66#h336003b7\\" style=\\"color: rgb(0, 136, 204); text-decoration: none; cursor: pointer;\\" target=\\"_blank\\"><span style=\\"color:#d3d3d3;\\">ultra-hip decor</span></a><span style=\\"color:#d3d3d3;\\">, and start planning your visit.</span></span></span></p>\r\n	<p style=\\"margin: 0px 0px 9px; padding: 0px; border: 0px; font-variant: inherit; font-stretch: inherit; vertical-align: baseline; line-height: 18px;\\">\r\n		<span style=\\"font-family:arial,helvetica,sans-serif;\\"><span style=\\"font-size:12px;\\"><span style=\\"color:#d3d3d3;\\"><strong style=\\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-stretch: inherit; vertical-align: baseline; line-height: 1;\\">$48 ($80 value) for a ticket package for two including two pairs of gloves, two parkas, and two 5x7 photos</strong></span></span></span></p>\r\n	<p style=\\"margin: 0px 0px 9px; padding: 0px; border: 0px; font-variant: inherit; font-stretch: inherit; vertical-align: baseline; line-height: 18px;\\">\r\n		<span style=\\"font-family:arial,helvetica,sans-serif;\\"><span style=\\"font-size:12px;\\"><span style=\\"color:#d3d3d3;\\">OR</span></span></span></p>\r\n	<p style=\\"margin: 0px 0px 9px; padding: 0px; border: 0px; font-variant: inherit; font-stretch: inherit; vertical-align: baseline; line-height: 18px;\\">\r\n		<span style=\\"font-family:arial,helvetica,sans-serif;\\"><span style=\\"font-size:12px;\\"><span style=\\"color:#d3d3d3;\\"><strong style=\\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-stretch: inherit; vertical-align: baseline; line-height: 1;\\">$90 ($150 value) for a VIP experience for two, including:</strong><br />\r\n		&bull; Two cocktails<br />\r\n		&bull; Two pairs of gloves<br />\r\n		&bull; Two faux-fur coat upgrades<br />\r\n		&bull; Two souvenir hats<br />\r\n		&bull; Two framed 5x7 photos</span></span></span></p>\r\n	<p style=\\"margin: 0px 0px 9px; padding: 0px; border: 0px; font-variant: inherit; font-stretch: inherit; vertical-align: baseline; line-height: 18px;\\">\r\n		&nbsp;</p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n', 'Minus5 Ice Bar New York, NY ', '54224148033342e0c_f1f9_4991_bb0a_1eb30c941a03_700_q90.jpg', '', 'https://www.livingsocial.com/events/1398960-ice-bar-experience-for-two-drinks-photos-more', '48', '2015-03-16 18:02:34', '0', '5', '112', '365', '0', '', '100', ''),
(18, '2015-04-01', '2015-09-20', 'Alvin Ailey Extension, Dance, Yoga, and so much more...', '<p>\r\n	<span style="color:#d3d3d3;"><span style="font-family:arial,helvetica,sans-serif;"><span style="font-size:12px;"><span style="line-height: 20px;">Professional instructors offer the best in Dance, Yoga, Exersize and it&#39;s all a blast, by yourself or on a date or with friends. &nbsp;Classes start at $20, $25 and $40.... &nbsp;And the have an app to download to see it all.</span></span></span></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n', '405 W 55 St New-York ', '1442566862extension_beginner_salsa_1.jpg', '', 'https://www.aileyextension.com/techniques', '20', '2015-06-04 12:16:06', '0', '5', '112', '365', '0', '', '100', ''),
(19, '2015-05-27', '2015-08-23', 'Shakespeare in the Park', '<p>\r\n	<span style="color:#d3d3d3;"><span style="font-size:12px;"><span style="font-family:arial,helvetica,sans-serif;">It&#39;s time for you to rediscover Shakespeare art and open your mind.&nbsp;</span></span></span></p>\r\n<p>\r\n	<span style="color:#d3d3d3;"><span style="font-size: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-family: &quot;Knockout 51 A&quot;, &quot;Knockout 51 B&quot;;">Directions</span></span></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Knockout 31 A&quot;, &quot;Knockout 31 B&quot;; font-size: 15px; vertical-align: baseline; color: rgb(0, 0, 0);">\r\n	<span style="color:#d3d3d3;"><span class="font_8" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; font-size: inherit; vertical-align: baseline;">Free Shakespeare in the Park is performed at the Delacorte Theater in Central Park. The Central Park entrances closest to the theater are at 81st Street and Central Park West or 79th Street and Fifth Avenue.</span></span></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Knockout 31 A&quot;, &quot;Knockout 31 B&quot;; font-size: 15px; vertical-align: baseline; color: rgb(0, 0, 0);">\r\n	<span style="color:#d3d3d3;"><span class="font_8" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; font-size: inherit; vertical-align: baseline;">The Delacorte Theater is easily accessible from the B, C and 6 subway lines, as well as from the M2, M3, M4, M10 and M79 bus lines. Once in the Park, follow the footpath to the Delacorte Theater. For those traveling by car, please note that there are no parking facilities in the Park.</span></span></p>\r\n<p class="headLvl2" style="box-sizing: border-box; margin: 10px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Knockout 51 A&quot;, &quot;Knockout 51 B&quot;; font-size: 18px; vertical-align: baseline; color: rgb(0, 0, 0);">\r\n	<span style="color:#d3d3d3;"><span class="font_8" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; font-size: inherit; vertical-align: baseline;">Parking</span></span></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Knockout 31 A&quot;, &quot;Knockout 31 B&quot;; font-size: 15px; vertical-align: baseline; color: rgb(0, 0, 0);">\r\n	<span style="color:#d3d3d3;">For those driving to the Delacorte Theater in Central Park, we know that finding parking can be difficult. We have partnered with&nbsp;</span><a href="https://www.parkingpanda.com/?ref=public" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-size: inherit; vertical-align: baseline; text-decoration: none; color: rgb(239, 65, 53); cursor: pointer;" target="_blank"><span style="color:#d3d3d3;">Parking Panda</span></a><span style="color:#d3d3d3;">, the nationwide leader in online parking reservations, to allow visitors to&nbsp;</span><a href="https://www.parkingpanda.com/delacorte-theater-new-york-parking?ref=public" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-size: inherit; vertical-align: baseline; text-decoration: none; color: rgb(239, 65, 53); cursor: pointer;" target="_blank"><span style="color:#d3d3d3;">purchase guaranteed parking at several convenient locations near the Delacorte Theater</span></a><span style="color:#d3d3d3;">.</span></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Knockout 31 A&quot;, &quot;Knockout 31 B&quot;; font-size: 15px; vertical-align: baseline; color: rgb(0, 0, 0);">\r\n	<span style="color:#d3d3d3;">Once purchased, parking passes are emailed instantly and guarantee you access to your selected location. Parking is very limited and locations fill up, so we recommend that you reserve your spot early.</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n', 'Delacorte Theater in Central Park at 81st Street and Central Park West', '969199387shakespere_in_the_park_nyc.jpg', '', 'http://www.publictheater.org/en/programs--events/shakespeare-in-the-park/?SiteTheme=Shakespeare', '0', '2015-06-04 12:28:29', '0', '5', '112', '365', '0', '', '100', ''),
(23, '2015-05-01', '2015-09-15', 'La Piscine at Hotel Americano ', '<p>\r\n	<span style="font-family:arial,helvetica,sans-serif;"><span style="color:#d3d3d3;"><span style="font-size:12px;"><span style="line-height: 24px;">La Piscine is located on the roof of Hotel Americano. A Mediterranean grill all summer with sweeping views of New York City.&nbsp;</span></span></span></span></p>\r\n<p>\r\n	<span style="font-family:arial,helvetica,sans-serif;"><span style="color:#d3d3d3;"><span style="line-height: 24px;">LA PISCINE<br />\r\n	A Mediterranean grill all summer along with sweeping views of New York City. Make reservations online by clicking the picture, calling 212-525-0000 or by email at lapiscine@hotel-americano.com</span></span></span></p>\r\n<h2 class="entry-title" style="margin: 0px 0px 12px; padding: 0px; border: 0px; outline: 0px; font-size: 26px; vertical-align: baseline; background: rgb(0, 0, 0); font-weight: normal; clear: both; font-family: &quot;Trade Gothic W01 Bold&quot;, Arial, sans-serif; text-transform: uppercase; line-height: 26px; color: rgb(0, 0, 0);">\r\n	&nbsp;</h2>\r\n', '518 W 27th Street ', '644445130Hotel_Americano_nyc.jpg', 'lapiscine@hotel-americano.com', 'http://www.opentable.com/la-piscine', '', '2015-06-04 16:03:16', '0', '5', '112', '365', '0', '', '100', ''),
(24, '2015-01-01', '2015-12-31', 'Blue Smoke Restaurant ', '<p>\r\n	<span style="color:#d3d3d3;"><span style="font-family:arial,helvetica,sans-serif;">One of the best BBQ restaurant in NYC! &nbsp;</span></span><span style="font-size:14px;"><span style="font-family:arial,helvetica,sans-serif;"><span style="color: rgb(136, 136, 136);">Founded in 2002 by Danny Meyer&rsquo;s Union Square Hospitality Group, and named after the curl of blue smoke that rises out of perfectly smoked meat, Blue Smoke celebrates the diverse culinary traditions of the American South with a range of soulful barbecue classics alongside revived family recipes and new favorites from Executive Chef Jean-Paul Bourgeois. An all-American beverage menu complements the Southern cooking with a wide range of whiskeys, wines, cocktails, and craft beers from coast to coast.</span></span></span></p>\r\n<p style="box-sizing: border-box; color: rgb(136, 136, 136); line-height: 1.5em; margin-bottom: 0px; font-family: &quot;Helvetica Neue&quot;, Helvetica, Helvetica, Arial, sans-serif; font-size: 16px;">\r\n	<span style="font-size:14px;"><span style="font-family:arial,helvetica,sans-serif;">The flagship Blue Smoke, with the club Jazz Standard, is located on East 27th Street in New York City, and a second location opened in 2012 in NYC&#39;s Battery Park City. Blue Smoke also has two Blue Smoke on the Road baseball concessions at Citi Field, home of the New York Mets, and the Washington Nationals ballpark. In 2013, Blue Smoke on the Road opened at Delta Terminal 4 in John F. Kennedy International Airport.</span></span></p>\r\n', '116 E 27th St btwn Park Ave South and Lexington Ave', '82177659501_Blue_Smoke_NYC.jpg', '', 'http://www.bluesmoke.com', '', '2015-06-04 16:17:19', '0', '5', '112', '365', '0', '', '100', ''),
(28, '2015-01-01', '2015-12-31', 'Les Ombres', '<p>\r\n	<span style="font-size:14px;"><span style="color:#d3d3d3;"><span style="line-height: 20px;">The full-on view of the&nbsp;</span></span><a href="http://www.timeout.com/paris/en/restaurants/{venue:1:9676:Attractions:Eiffel%20Tower}" style="box-sizing: border-box; background-color: transparent; color: rgb(225, 25, 44); text-decoration: none; font-family: OpenSans, Arial, sans-serif; font-size: 14px; line-height: 20px;"><span style="color:#d3d3d3;">Eiffel Tower</span></a><span style="color:#d3d3d3;"><span style="line-height: 20px;">&nbsp;at night would be reason enough to come to this glass-and-iron restaurant on the top floor of the&nbsp;</span></span><a href="http://www.timeout.com/paris/en/restaurants/{venue:1:9680:Museums:Mus%C3%A9e%20du%20Quai%20Branly}" style="box-sizing: border-box; background-color: transparent; color: rgb(225, 25, 44); text-decoration: none; font-family: OpenSans, Arial, sans-serif; font-size: 14px; line-height: 20px;"><span style="color:#d3d3d3;">Mus&eacute;e du Quai Branly</span></a><span style="color:#d3d3d3;"><span style="line-height: 20px;">. You can also head to the newly opened terrace lounge bar, which offers a range of swish cocktails (&euro;13) and posh nibbles to consume on one of its delightfully plush sofas. You&#39;ll feel like you&#39;ve strolled into a postcard. ..........................................................&nbsp;</span></span></span><span style="font-size:12px;"><big><span style="font-family:arial,helvetica,sans-serif;"><span style="color:#d3d3d3;"><span style="text-align: justify;">Au c&oelig;ur du luxuriant jardin du mus&eacute;e du quai Branly, perch&eacute; sur le toit-terrasse, le restaurant LES OMBRES offre une vue panoramique unique sur Paris, &agrave; l&rsquo;ombre de sa voisine, la Tour Eiffel, qui projette le jour ses dentelles m&eacute;talliques sur les nappes et le soir, enflamme la salle. Un ensemble d&rsquo;exception sign&eacute; Jean Nouvel.</span></span></span></big></span></p>\r\n<p>\r\n	<br style="color: rgb(77, 77, 77); font-family: tahoma, geneva, sans-serif; font-size: 11px; text-align: justify;" />\r\n	<span style="font-size:12px;"><big><span style="font-family:arial,helvetica,sans-serif;"><span style="color:#d3d3d3;"><span style="text-align: justify;">Table parisienne raffin&eacute;e, le restaurant LES OMBRES s&eacute;duit par sa cuisine &agrave; la fois contemporaine, ouverte sur le monde et audacieuse pour sublimer les saveurs du produit.&nbsp;</span><br style="color: rgb(77, 77, 77); font-family: tahoma, geneva, sans-serif; font-size: 11px; text-align: justify;" />\r\n	<span style="text-align: justify;">Totalement vitr&eacute;, le restaurant LES OMBRES s&rsquo;ouvre sur une terrasse a&eacute;rienne panoramique. Ouvert tous les jours, pour d&eacute;jeuner ou d&icirc;ner, ind&eacute;pendamment des horaires du mus&eacute;e.</span></span></span></big></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<body id="cke_pastebin" style="position: absolute; top: 34px; width: 1px; height: 1px; overflow: hidden; left: -1000px;">\r\n	<p>\r\n		<span style="font-size: 14px;"><span style="color: rgb(211, 211, 211);"><span style="font-family: tahoma, geneva, sans-serif; text-align: justify;">Au c&oelig;ur du luxuriant jardin du mus&eacute;e du quai Branly, perch&eacute; sur le toit-terrasse, le restaurant LES OMBRES offre une vue panoramique unique sur Paris, &agrave; l&rsquo;ombre de sa voisine, la Tour Eiffel, qui projette le jour ses dentelles m&eacute;talliques sur les nappes et le soir, enflamme la salle. Un ensemble d&rsquo;exception sign&eacute; Jean Nouvel.</span></span></span></p>\r\n	<p>\r\n		<br style="color: rgb(77, 77, 77); font-family: tahoma, geneva, sans-serif; font-size: 11px; text-align: justify;" />\r\n		<span style="font-size: 14px;"><span style="color: rgb(211, 211, 211);"><span style="font-family: tahoma, geneva, sans-serif; text-align: justify;">Table parisienne raffin&eacute;e, le restaurant LES OMBRES s&eacute;duit par sa cuisine &agrave; la fois contemporaine, ouverte sur le monde et audacieuse pour sublimer les saveurs du produit.&nbsp;</span><br style="color: rgb(77, 77, 77); font-family: tahoma, geneva, sans-serif; font-size: 11px; text-align: justify;" />\r\n		<span style="font-family: tahoma, geneva, sans-serif; text-align: justify;">Totalement vitr&eacute;, le restaurant LES OMBRES s&rsquo;ouvre sur une terrasse a&eacute;rienne panoramique. Ouvert tous les jours, pour d&eacute;jeuner ou d&icirc;ner, ind&eacute;pendamment des horaires du mus&eacute;e.</span></span></span></p>\r\n</body>\r\n', '27 Quai Branly - VIIe PARIS', '1023033613141028_OMBRES_RESTAU_2_464X243.jpg', '', 'http://www.lesombres-restaurant.com', '', '2015-06-09 12:31:55', '0', '5', '153', '365', '0', '', '100', ''),
(29, '2015-01-01', '2015-12-31', 'Shuko', '<p style="box-sizing: inherit; margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: vaud, arial; vertical-align: baseline; color: rgb(204, 204, 204); text-align: center; background-color: rgb(32, 32, 32);">\r\n	Shuko offers daily tasting menus from Chefs Nick Kim and Jimmy Lau based on traditional Japanese flavors and techniques from the kitchen and sushi bar. Our menu reflects the best fish selections and seasonal ingredients sourced locally and internationally.</p>\r\n<p style="box-sizing: inherit; margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: vaud, arial; vertical-align: baseline; color: rgb(204, 204, 204); text-align: center; background-color: rgb(32, 32, 32);">\r\n	We take reservations 14 days in advance, both at tables and at the sushi counter. You must request your preferred seating at the time of making your reservation. Due to high demand and the nature of our menu, we allow a certain time for guests dining. We will only hold a reservation for 15 minutes, otherwise you will have to wait for the next time we can accommodate, which may be a different day.</p>\r\n<p style="box-sizing: inherit; margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: vaud, arial; vertical-align: baseline; color: rgb(204, 204, 204); text-align: center; background-color: rgb(32, 32, 32);">\r\n	We require a valid credit card to hold all reservations. Our cancellation policy involves a charge of $135 per person if the reservation hasn&#39;t been cancelled at least 24 hours in advance for parties of 4 or less, and 48 hours for parties of 5 or more.</p>\r\n', '47E 12th St New-York 10003', '1463468513Shuko_nyc.jpg', '', 'http://www.shukonyc.com/', '', '2015-06-09 12:34:34', '0', '5', '112', '365', '0', '', '100', ''),
(31, '2015-01-01', '2015-12-31', 'Aldo Sohm Wine Bar ', '<p>\r\n	<span style="font-size:16px;"><span style="color:#a9a9a9;"><span style="font-family: &quot;Trade Gothic W01 Cn 18&quot;;">Located in midtown and inspired by each city block, Aldo Sohm Wine Bar embodies the energy of New York with the laid back atmosphere of Aldo&rsquo;s own living room. Designed with wine director Aldo&rsquo;s relaxed approach to good food and wine in mind, we invite you to drink, eat, share, relax and enjoy.</span></span></span></p>\r\n', '151 West 51st Street btwn Sixth and Seventh Aves - NewYork - 10019', '1328567205bars150504_aldosohm_560_nyc.jpg', '', 'http://www.aldosohmwinebar.com/', '', '2015-06-09 12:57:54', '0', '5', '112', '365', '0', '', '100', ''),
(32, '2015-01-01', '2015-12-31', 'Standard Downtown', '<p>\r\n	<span style="color:#d3d3d3;"><span style="font-size:12px;"><span style="font-family:arial,helvetica,sans-serif;"><big><span style="line-height: 21px;">The Rooftop at The Standard, Downtown LA offers stunning, panoramic views of Downtown Los Angeles and the mountains beyond.&nbsp;The Rooftop features a heated swimming pool, red AstroTurf deck, dance floor, nightly DJs, bar, outdoor fireplace, waterbed pods, sculptured topiary and a Biergarten.&nbsp;</span></big></span></span></span></p>\r\n', '550 S Flower St - Los Angeles', '1990108402standard_roottop_LA.jpg', '', 'http://www.standardhotels.com', '', '2015-06-09 13:02:43', '0', '41', '113', '365', '0', '', '100', ''),
(33, '2015-01-01', '2015-12-31', 'SkyBar', '<p>\r\n	<span style="font-size:12px;"><span style="color:#d3d3d3;"><big><span style="font-family:arial,helvetica,sans-serif;"><span style="line-height: 25px;">The beautifully designed hotel pool, set flush with the surrounding teak deck and featuring soothing underwater music, is the perfect spot for lounging and enjoying the stunning panoramic views of Los Angeles.</span></span></big></span></span></p>\r\n', 'Mondrian Hotel - 8440 Sunset Blvd - Los Angeles', '1378989100Mondrian_Hotel___8440_Sunset_Blvd___Los_Angeles.jpg', '', 'https://www.morganshotelgroup.com/mondrian/mondrian-los-angeles', '', '2015-06-09 13:07:43', '0', '41', '113', '365', '0', '', '100', ''),
(34, '2015-01-01', '2015-12-31', 'Corkbuzz Wine Studio', '<h1 style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin: 0px; padding: 0px 0px 8px; font-family: &quot;Open Sans&quot;, verdana, helvetica, sans-serif; font-size: 15px; line-height: 20px; color: rgb(111, 111, 117); font-weight: normal;">\r\n	<span style="color:#d3d3d3;">Our Philosophy</span></h1>\r\n<p style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin: 0px; padding: 0px; color: rgb(54, 54, 54); font-family: &quot;Open Sans&quot;, verdana, helvetica, sans-serif;">\r\n	<span style="color:#d3d3d3;">We believe in enjoying wine and talking about wine in a way that makes everyone feel welcome and never intimidated.</span></p>\r\n<p style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin: 0px; padding: 0px; color: rgb(54, 54, 54); font-family: &quot;Open Sans&quot;, verdana, helvetica, sans-serif;">\r\n	&nbsp;</p>\r\n<p style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin: 0px; padding: 0px; color: rgb(54, 54, 54); font-family: &quot;Open Sans&quot;, verdana, helvetica, sans-serif;">\r\n	<span style="color:#d3d3d3;">Corkbuzz is many things:</span></p>\r\n<ul style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin: 5px 10px 0px 12px; padding-right: 10px; padding-left: 12px; list-style: none; color: rgb(54, 54, 54); font-family: &quot;Open Sans&quot;, verdana, helvetica, sans-serif;">\r\n	<li style="background: transparent; border: 0px; margin: 0px; padding: 0px 0px 6px; list-style-type: circle;">\r\n		<span style="color:#d3d3d3;">A wine bar, where you can meet up with your best friends as well as make new ones.</span></li>\r\n	<li style="background: transparent; border: 0px; margin: 0px; padding: 0px 0px 6px; list-style-type: circle;">\r\n		<span style="color:#d3d3d3;">A wine-centric restaurant, where wine lovers, grape growers, sommeliers, chefs and winemakers come together to share their common enthusiasm for wine.</span></li>\r\n	<li style="background: transparent; border: 0px; margin: 0px; padding: 0px 0px 6px; list-style-type: circle;">\r\n		<span style="color:#d3d3d3;">A home base for wine education, where you can take recreational classes to help you understand what you like in a wine as well as more in-depth classes that can provide you with the knowledge to pursue a professional career in wine.</span></li>\r\n	<li style="background: transparent; border: 0px; margin: 0px; padding: 0px 0px 6px; list-style-type: circle;">\r\n		<span style="color:#d3d3d3;">An event space, where wine dinners and parties encourage new conversations and relationships.</span></li>\r\n</ul>\r\n<p style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin: 0px; padding: 0px; color: rgb(54, 54, 54); font-family: &quot;Open Sans&quot;, verdana, helvetica, sans-serif;">\r\n	&nbsp;</p>\r\n<p style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin: 0px; padding: 0px; color: rgb(54, 54, 54); font-family: &quot;Open Sans&quot;, verdana, helvetica, sans-serif;">\r\n	<span style="color:#d3d3d3;">Whether you&rsquo;re a novice or an expert, we want you to mingle, drink, laugh and indulge.</span></p>\r\n', '13 E 13th Street btwn Fifth Ave and University Pl', '315804421corkbuzz_wine_studio_nyc.jpg', '', 'http://corkbuzz.com/', '', '2015-06-09 13:08:17', '0', '5', '112', '365', '0', '', '100', ''),
(35, '2015-01-01', '2015-12-31', 'The Metropolitan Museum of Art ', '<p>\r\n	<span class="notranslate" style="box-sizing: inherit; color: rgb(153, 153, 153); font-family: MetSans, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px;">The&nbsp;<em style="box-sizing: inherit;">Metropolitan Museum of Art&nbsp;</em></span><em style="box-sizing: inherit; color: rgb(153, 153, 153); font-family: MetSans, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px;">Guide</em><span style="color: rgb(153, 153, 153); font-family: MetSans, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px;">&nbsp;provides a comprehensive view of art history spanning five millennia and the entire globe.</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<span style="color: rgb(153, 153, 153); font-family: MetSans, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px;">Experience the best of human creativity from every corner of the globe at The Met.</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<span style="color: rgb(153, 153, 153); font-family: MetSans, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px;">Explore highlights of the collection through a variety of tours.</span></p>\r\n', '1000 5th Ave - New York - NY 10028', '390219518NYC___Metropolitan_Museum___Carroll_and_Milton_Petrie_European_Sculpture_Court.jpg', '', 'http://www.metmuseum.org/', '25.00', '2015-06-09 13:18:12', '0', '5', '112', '365', '0', '', '100', ''),
(36, '2015-01-01', '2015-12-31', 'Bar 1886', '<p>\r\n	<span style="font-family: ''Open Sans'', Arial, Helvetica, sans-serif; font-size: 15px; line-height: 20px;">Bar 1886 boasts a&nbsp;repertoire&nbsp;of over 600 off-menu house cocktails, including the famous Honey-Nut Old Fashioned, the Smoking Jacket, and a complete series of Pimm&rsquo;s Cups 1 through 13 &ndash; made from scratch and unavailable anywhere else on the planet. The cocktail list uses seasonal and regional ingredients, a broad range of spirits, and playful presentations. If&nbsp;you don&rsquo;t see exactly what you&rsquo;re thirsty for on the menu, request a &ldquo;dealer&rsquo;s choice&rdquo; and let the bartender create the perfect drink for you, based on your personal tastes or preference.</span></p>\r\n', '1250 S Fair Oaks Ave - Los Angeles', '336248448bar1886_LA_CA.jpg', '', 'http://theraymond.com', '', '2015-06-09 13:21:32', '0', '41', '113', '365', '0', '', '100', ''),
(37, '2016-01-01', '2017-12-31', 'Santa Monica Pier', '<h3 style="font-size: 20px; margin: 0em 0px 0px; color: rgb(0, 0, 0); font-weight: normal; font-stretch: normal; line-height: 1.3em; font-family: alternate-gothic-no-3-d-n4, alternate-gothic-no-3-d, sans-serif; text-transform: uppercase;">\r\n	<span style="color:#a9a9a9;">HOURS</span></h3>\r\n<p style="margin: 0.125em 0px 1em; color: rgb(0, 0, 0); font-size: 15px; font-family: futura-pt, serif;">\r\n	<span style="color:#a9a9a9;">The Pier is always open, and always fun, year-round. But check with individual businesses for their specific hours of operation.</span></p>\r\n<h3 style="font-size: 20px; margin: 0.5em 0px 0px; color: rgb(0, 0, 0); font-weight: normal; font-stretch: normal; line-height: 1.3em; font-family: alternate-gothic-no-3-d-n4, alternate-gothic-no-3-d, sans-serif; text-transform: uppercase;">\r\n	<span style="color:#a9a9a9;">DIRECTIONS</span></h3>\r\n<p style="margin: 0.125em 0px 1em; color: rgb(0, 0, 0); font-size: 15px; font-family: futura-pt, serif;">\r\n	<span style="color:#a9a9a9;">Go west. If your shoes are wet, you&#39;ve gone too far. The ramp at the intersection of Ocean and Colorado is your most direct route by car, bike or foot. If you know where you&rsquo;re coming from,&nbsp;</span><br />\r\n	<a href="https://maps.google.com/maps?ie=UTF8&amp;cid=1094900940278605226&amp;q=Santa+Monica+Pier&amp;iwloc=A&amp;gl=US&amp;hl=en" style="text-decoration: none; color: rgb(238, 89, 80);" target="_blank" title="Google Maps location of Santa Monica Pier"><span style="color:#a9a9a9;">click here</span></a><span style="color:#a9a9a9;">&nbsp;to map your route.</span></p>\r\n<h3 style="font-size: 20px; margin: 0.5em 0px 0px; color: rgb(0, 0, 0); font-weight: normal; font-stretch: normal; line-height: 1.3em; font-family: alternate-gothic-no-3-d-n4, alternate-gothic-no-3-d, sans-serif; text-transform: uppercase;">\r\n	<span style="color:#a9a9a9;">VISITOR INFO &amp; SHOP</span></h3>\r\n<p style="margin: 0.125em 0px 1em; color: rgb(0, 0, 0); font-size: 15px; font-family: futura-pt, serif;">\r\n	<span style="color:#a9a9a9;">Stop by the Pier Shop at the bottom of the ramp for visitor info, Pier history and official apparel. Need info on what to do in Santa Monica? Check out&nbsp;</span><a href="http://www.santamonica.com/" style="text-decoration: none; color: rgb(238, 89, 80);" target="_blank"><span style="color:#a9a9a9;">SantaMonica.com</span></a></p>\r\n<h3 style="font-size: 20px; margin: 0.5em 0px 0px; color: rgb(0, 0, 0); font-weight: normal; font-stretch: normal; line-height: 1.3em; font-family: alternate-gothic-no-3-d-n4, alternate-gothic-no-3-d, sans-serif; text-transform: uppercase;">\r\n	<span style="color:#a9a9a9;">PARKING</span></h3>\r\n<p style="margin: 0.125em 0px 1em; color: rgb(0, 0, 0); font-size: 15px; font-family: futura-pt, serif;">\r\n	<span style="color:#a9a9a9;">There is parking on the Pier deck, accessible via the ramp at Ocean and Colorado. There are&nbsp;<br />\r\n	also two lower lots accessible via Appian Way.&nbsp;</span><a class="fancybox" href="http://santamonicapier.org/wp-content/uploads/2012/09/SMP_Visit_ParkingMapWindow.jpg" rel="fancybox" style="text-decoration: none; color: rgb(238, 89, 80);"><span style="color:#a9a9a9;">Click here</span></a><span style="color:#a9a9a9;">&nbsp;for a map and&nbsp;</span><a class="fancybox" href="http://www.smgov.net/Departments/PCD/Transportation/Motorists-Parking/Where-to-Park/" style="text-decoration: none; color: rgb(238, 89, 80);"><span style="color:#a9a9a9;">click here</span></a><span style="color:#a9a9a9;">&nbsp;for all the seasonal rates and hours.</span></p>\r\n<p style="margin: 0.125em 0px 1em; color: rgb(0, 0, 0); font-size: 15px; font-family: futura-pt, serif;">\r\n	<span style="color:#a9a9a9;">Want to make this even easier? We recommend reserving a discounted parking&nbsp;<br />\r\n	spot in advance&nbsp;</span><a href="http://www.parkme.com/pier" style="text-decoration: none; color: rgb(238, 89, 80);" target="_blank"><span style="color:#a9a9a9;">here</span></a><span style="color:#a9a9a9;">.</span></p>\r\n', '200 Santa Monica Pier - Santa Monica', '2008086688200santamonicapier_CA.jpg', '', 'http://santamonicapier.org/fun/', '', '2015-06-09 13:45:16', '0', '41', '113', '365', '0', '', '100', ''),
(1009, '2017-01-01', '2017-12-31', 'The Fondation Louis Vuitton', '<p class="Normal1" style="box-sizing: inherit; margin: 0px 0px 15px; padding: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;Open Sans&quot;, Arial, sans-serif; color: rgb(29, 29, 27);">\r\n	<span style="color:#d3d3d3;">The Fondation Louis Vuitton modern art gallery opened in the&nbsp;</span><a href="http://www.timeout.com/paris/en/sport/bois-de-boulogne%20" style="box-sizing: inherit; background-color: transparent; text-decoration: none; color: rgb(225, 25, 44);"><span style="color:#d3d3d3;">Bois de Boulogne</span></a><span style="color:#d3d3d3;">, Paris&rsquo;s second largest public park, in October 2014. Designed by architect Frank Gehry, the impressive new space plays host to Louis Vuitton Group CEO Bernard Arnault&rsquo;s art collection.&nbsp;</span></p>\r\n<p class="Normal1" style="box-sizing: inherit; margin: 0px 0px 15px; padding: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;Open Sans&quot;, Arial, sans-serif; color: rgb(29, 29, 27);">\r\n	<span style="color:#d3d3d3;">Visually stunning, the FLV is shell-shaped and made up of twelve glass sails that soar above the park&#39;s greenery. Inside is a huge auditorium and 3,850m2 of exhibition space divided into eleven galleries; comparatively modest next to Gehry&rsquo;s Guggenheim museum in Bilbao.</span></p>\r\n<p class="Normal1" style="box-sizing: inherit; margin: 0px 0px 15px; padding: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;Open Sans&quot;, Arial, sans-serif; color: rgb(29, 29, 27);">\r\n	<span style="color:#d3d3d3;">Skeptics see this new building as an excessive expense on the Louis Vuitton Group&rsquo;s part: A trophy rather than an innovative art gallery that simply goes to show the luxury goods industry&rsquo;s hold over modern art. The gallery is pointedly located in the wealthy outskirts of Paris, and you won&#39;t find any new young talents on the program &ndash; Bernault&rsquo;s philanthropy is more likely to boost his artistic investments rather than lend a hand to struggling artists.&nbsp;&nbsp;</span></p>\r\n<p class="Normal1" style="box-sizing: inherit; margin: 0px 0px 15px; padding: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;Open Sans&quot;, Arial, sans-serif; color: rgb(29, 29, 27);">\r\n	<span style="color:#d3d3d3;">Nonetheless, this grandiose modern art gallery will excel where it intends to: welcoming the celebrities of contemporary art to its walls. While it may not revolutionise our cultural landscape, it should enable Paris to see some of the world&#39;s greatest works of art in a beautiful setting.&nbsp;</span></p>\r\n', 'Paris', '851181881foundation_louis_vuitton_paris.jpg', '', 'https://www.timeout.com/paris/en/art/fondation-louis-vuitton', '', '2016-10-25 22:11:40', '0', '5', '153', '365', '0', '', '100', '');
