INSERT INTO `torb_questions` (`id`, `groupid`, `torb_question`) VALUES
(1, '1', 'It''s Sunday morning.  You''ve just woken up, no real plans, it''s a cool sunny day in Autumn... What''s gonna happen next?'),
(2, '1', 'Cake or Pie?  Which and Why?'),
(3, '2', 'If you could jump on a plane and go anywhere right now, where would you go?  How long would you stay?'),
(4, '2', 'Where did you grow up?  What was it like where you lived?'),
(5, '2', 'What do you consider to be your most important Values?'),
(6, '3', 'Do you remember your very first kiss? Would you be willing to share the scene and how you felt?'),
(7, '3', 'Are you comfortable with looking deep into someone''s eyes for at least 60 seconds?'),
(8, '1', 'What''s your idea of fun?'),
(9, '1', 'Do you like to Dance? What kind of dancing do you like?'),
(10, '2', 'You have a choice... family dinner, church service or front row seats to your favorite sport... Which do you choose and who is with you?'),
(11, '2', 'Who would you like to hang with tonight; friends, family or a blind date?'),
(12, '3', 'A soft touch or a hard spank.  Which do you prefer?  Are you giving or receiving? '),
(13, '3', 'A hard kiss or a soft bite... Which do you prefer?  Are you giving or receiving?'),
(14, '1', 'A roller coaster, a rowboat, or a horseback ride... Which would be you favorite thing to do?'),
(15, '1', 'A scary movie, an action movie, a love story or a comedy?  Or maybe you''d prefer Indie and out of the box... What and Why?'),
(26, '1', 'It''s Fall in NYC... It''s Sunday... Long drive or walk in the city?'),
(25, '3', 'It''s a snow storm and we can''t get to each other... What do we do?'),
(27, '2', 'Do you believe in Love at first sight?');
